import React from "react";

const Results = (props) => {
  const [display, setDisplay] = useState();

  const img = `https://source.unsplash.com/400x200/?${props.name}`;
  const img2 = `https://source.unsplash.com/150x200/?${props.name}`;
  const img3 = `https://source.unsplash.com/130x200/?${props.name}`;
  const img4 = `https://source.unsplash.com/155x200/?${props.name}`;
  const img5 = `https://source.unsplash.com/122x200/?${props.name}`;
  const img6 = `https://source.unsplash.com/300x200/?${props.name}`;

  return (
    <div>
      <div>
        <img src={img} alt="search" />
        <img src={img2} alt="search" />
        <img src={img3} alt="search" />
      </div>
      <div>
        <img src={img4} alt="search" />
        <img src={img5} alt="search" />
        <img src={img6} alt="search" />
      </div>
    </div>
  );
};

export default Results;
